(467, 4, 'BBQ Manual Grill Stand', 'bbq-manual-grill-stand', '<p><strong>BBQ Manual Grill Stand</strong></p>\r\n<p>&nbsp;</p>\r\n<div class=\"html-content pdp-product-highlights\">\r\n<ul class=\"\">\r\n<li class=\"\">GO ANYWHERE: This tiny portable charcoal grill can go with you and your family for a road trip or a beach party etc. Perfect for 3-5 people family/party.</li>\r\n<li class=\"\">COMPACT and STURDY: Made of cold-rolled iron and premium chrome Wire mesh. Heat-resistant and scratch-resistant. Legs are more sturdy than similar products.</li>\r\n<li class=\"\">FOLDABLE EASY STORAGE: It can be folded away after you use. Handle designed make it save space and is convenient to take it to anywhere to have fun.</li>\r\n<li class=\"\">12 AIRWAY VENT: Star a fire Faster and Easier with 12 Airway Vent design. Easy to clean as the baking net can be pulled out. WARNING: Use it on a flat, sturdy surface or table.</li>\r\n<li class=\"\">PERFECT GIFT: Uten folding portable lightweight BBQ grill is a perfect BBQ tool for beach, picnics, parties, trailers, a camping trip or anywhere you want.</li>\r\n<li class=\"\">Specifications:</li>\r\n<li class=\"\">ight &amp; portable</li>\r\n<li class=\"\">Clean and smokeless grilling</li>\r\n<li class=\"\">Durable stainless steel heating element</li>\r\n<li class=\"\">With ignition device: Not included</li>\r\n<li class=\"\">Fuel: Charcoal</li>\r\n<li class=\"\">Model: KYZ-SKL013</li>\r\n<li class=\"\">Structure: One piece</li>\r\n<li class=\"\">Applicable: 3 - 5 persons</li>\r\n<li class=\"\">Stove type: Combination stove</li>\r\n<li class=\"\">Material: Stainless Steel</li>\r\n<li class=\"\">Outdoor use</li>\r\n<li class=\"\">Weight: 2kg</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.4796I40kI40kSx\">Open Size: 35 x 27 x 19.5cm</li>\r\n<li class=\"\">Heat resistant painted, health care</li>\r\n<li class=\"\">Chrome plated, stainless quality</li>\r\n<li class=\"\">Good air vents design, easy to make fire</l