(471, 4, 'Folding Dish', 'folding-dish', '<p><strong>Folding Dish</strong></p>\r\n<p>Multi-function 3 in 1 Folding Cutting Board Kitchen Foldable Drain Basket Chopping Blocks Washing Basket Kitchen Organizer</p>\r\n<p><strong>Description: </strong></p>\r\n<p>ðŸ‘‰ 100% brand new and high quality with competitive price.</p>\r\n<p>ðŸ‘‰ Food grade PP material,safety and health,colorful color,frosted surface design,to avoid slippage when chopping.</p>\r\n<p>ðŸ‘‰ Product name:Folding Cutting Board</p>\r\n<p>ðŸ‘‰ Material:Food grade pp</p>\r\n<p>ðŸ‘‰ Size: as the picture</p>\r\n<p>ðŸ‘‰ Color:grey</p>\r\n<p>ðŸ‘‰ Size-Square with Leaky hole:40*30*14 cm</p>', 700, 590, 'SA-85', 0, 0, 1, '2022-10-05 04:37:08', '2022-10-05 04:37:08'),
(472, 4, 'Bathroom Sink Sink Power Dredger Sewer Pipe Cleaner Cup', 'bathroom-sink-sink-power-dredger-sewer-pipe-cleaner-cup', '<p><strong>Bathroom Sink Sink Power Dredger Sewer Pipe Cleaner Cup</strong></p>\r\n<ul class=\"\">\r\n<li class=\"\">Package included: Dredging tool for cleaning pipes 1 x</li>\r\n<li class=\"\">Specification: Type: Pipe dredger Material: PP + TPR + Silica Gel Color: Orange &amp; black Application: Sink, pool, sewer for bathroom, mop pool, bath, toilet, etc .. Size: 7 * 10 * 17cm Weight: 134g</li>\r\n<li class=\"\">How to use (step by step): Step 1 - Fill the water chamber Before using the Clog gun, you will need to fill its water chamber. To do this, turn the device so that the wider end is facing up, and fill it to the top without overflowing it.</li>\r\n<li class=\"\">Step 2 - Turn the device over After the water chamber of the device is full, quickly turn the tool over and place it directly over the clogged drain.</li>\r\n<li class=\"\" data-spm-anchor-id=\"a2a0e.pdp.product_detail.i1.1f84OceOOceOJX\">Step 3 - Click on the black surface After you turn the appliance over the sink, shower or bath, click on the round black surface that you will see at the top of the appliance. If you press down hard enough, it will send water into the clogged drain and clean up debris. However, if you press on it too lightly, you may need to push it again with more force to clear the drain.</li>\r\n<li class=\"\">Step 4 - Remove the appliance and check Finally, after you have completed the pressing step, remove the appliance from the sink and check the drain to make sure it is clear. If this is not the case, repeat the step.</li>\r\n</ul>', 700, 550, 'SA-86', 0, 0, 1, '2022-10-05 04:47:26', '2022-10-05 04:47:26'),
